import React, {FC} from "react";
import { IGoods } from "../types/types";
interface GoodsListProps {
    goods: IGoods[]
  }

const GoodsList: FC<GoodsListProps> = ({goods}) => {
    return (
        <div>
            {goods.map( good => {
        return (
          <div key={good.id}>
            <img src={good.image} alt="Img" height='200px' />
            <p>{good.size}</p>
            <p>{good.title} {good.desription}</p>
            <p>Штрихкод: {good.barcode}</p>
            <p>Производитель: {good.producer}</p>
            <p>Бренд: {good.brand}</p>
            <div>
              <p>{good.price} ₸</p>
              <button>В корзину</button>
            </div>
          </div>
        )
      })}
        </div>
    );
};

export default GoodsList;
